        this.state = {
            services: [
                ['About Us', 'Areas of Practice', 'Our Team', 'Research & Publications', 'Our Clientele'],
                ['Gallery', 'Our Achievements', 'Outstation Services', 'Other Services', 'Contact Us']
            ]
        }
    }

    render() {
        return (
            <div className="nav-row">
                {
                    this.state.services.map(services => {
                        return (
                            <ul>
                                {
                                    services.map(service => (
                                        <li className="">
                                            <a href={service}>{service}</a>
